typedef struct {
    int x, y;
} Point;

// add item to the queue
void enqueue(Point queue[], int *rear, Point item) {
    queue[(*rear)++] = item;
}

// remove and return item from the queue
Point dequeue(Point queue[], int *front) {
    return queue[(*front)++];
}


